export const setValueInput = (path) => {
  switch(pathname) {
    case '/phones':
      return value.phones;
    case '/tablets':
      return value.tablets;
    case '/accessories':
      return value.accessories;
    case '/favorites':
      return value.favorites;
    default:
      break;
  }
}
